pragma solidity ^0.8.0;

import "../lib/openzeppelin/token/ERC20/IERC20.sol";
import "../lib/openzeppelin/access/Ownable.sol";
import "../lib/openzeppelin/utils/math/SafeMath.sol";
import "../lib/uniswap/v2-core/contracts/interfaces/IUniswapV2Pair.sol";
import "../lib/uniswap/v3-periphery/contracts/interfaces/ISwapRouter.sol";

interface IWETH is IERC20 {
    function deposit() external payable;
    function withdraw(uint) external;
}

contract BlindBackrun_V3_V2 is Ownable {
    using SafeMath for uint256;

    address public immutable WETH_ADDRESS;
    ISwapRouter public immutable swapRouter;    

    constructor(address _wethAddress, address _swapRouterAddress) {
        WETH_ADDRESS = _wethAddress;
        swapRouter = ISwapRouter(_swapRouterAddress); 
    }

    /// @notice Executes an arbitrage transaction between Uniswap V3-V2 pairs.
    function executeArbitrage(
        bool isWETHZero,
        address secondPairAddress,
        uint amountIn,
        uint finalAmountOut,
        address token0,
        address token1,
        uint24 actualUniV3Fee,
        uint percentageToPayToCoinbase
    ) external onlyOwner {
        uint256 balanceBefore = IERC20(WETH_ADDRESS).balanceOf(address(this));
        address tokenOut;

        // Approve the firstPair to spend the contract's WETH.
        IERC20(WETH_ADDRESS).approve(address(swapRouter), amountIn);

        if (isWETHZero == true) {
            // swap WETH for token1
            tokenOut = token1;
        } else {
            // swap WETH for token0
            tokenOut = token0;
        }

        // Execute swap on the second Uniswap V3 pool
        ISwapRouter.ExactInputSingleParams memory params = ISwapRouter.ExactInputSingleParams(
            WETH_ADDRESS, // tokenIn - WETH Address
            tokenOut, // token address to swap for with WETH
            actualUniV3Fee, // Fee tier
            address(this), // Recipient of the output tokens
            block.timestamp + 1200, // Deadline for the transaction
            amountIn, // Amount of WETH to be swapped
            0, // Minimum Amount Out from this swap
            0 // sqrtPriceLimitX96, set to 0 to skip
        );

        swapRouter.exactInputSingle(params);

        // Get balance of the token acquired from the first swap
        uint256 tokenReceivedBalance = IERC20(tokenOut).balanceOf(address(this));

        // Approve the secondPair to spend the tokenReceived
        IERC20(tokenOut).approve(secondPairAddress, tokenReceivedBalance);

        // Send the amountIn to the Uniswap V2 pair.
        IERC20(tokenOut).transfer(secondPairAddress, tokenReceivedBalance);

        IUniswapV2Pair secondPair = IUniswapV2Pair(secondPairAddress); 

        if (tokenOut == secondPair.token0()) {
            secondPair.swap(
                0,                     // amount0Out
                finalAmountOut,        // amount1Out
                address(this),         // recipient
                ""                     // data
            );
        } else {
            secondPair.swap(
                finalAmountOut,        // amount0Out
                0,                     // amount1Out
                address(this),         // recipient
                ""                     // data
            );
        }

        uint256 balanceAfter = IERC20(WETH_ADDRESS).balanceOf(address(this));
        require(balanceAfter > balanceBefore, "Arbitrage failed");
        uint profit = balanceAfter.sub(balanceBefore);
        uint profitToCoinbase = profit.mul(percentageToPayToCoinbase).div(100);
        IWETH(WETH_ADDRESS).withdraw(profitToCoinbase);
        block.coinbase.transfer(profitToCoinbase);
    }

    /// @notice Transfers all WETH held by the contract to the contract owner.
    /// @dev Only the contract owner can call this function.
    function withdrawWETHToOwner() external onlyOwner {
        uint256 balance = IERC20(WETH_ADDRESS).balanceOf(address(this));
        IERC20(WETH_ADDRESS).transfer(msg.sender, balance);
    }

    /// @notice Transfers all ETH held by the contract to the contract owner.
    /// @dev Only the contract owner can call this function.
    function withdrawETHToOwner() external onlyOwner {
        uint256 balance = address(this).balance;
        payable(msg.sender).transfer(balance);
    }

    /// @notice Executes a call to another contract with the provided data and value.
    /// @dev Only the contract owner can call this function.
    /// @dev Reverted calls will result in a revert. 
    /// @param _to The address of the contract to call.
    /// @param _value The amount of Ether to send with the call.
    /// @param _data The calldata to send with the call.
    function call(address payable _to, uint256 _value, bytes memory _data) external onlyOwner {
        (bool success, ) = _to.call{value: _value}(_data);
        require(success, "External call failed");
    }

    /// @notice Fallback function that allows the contract to receive Ether.
    receive() external payable {}
}
